import axios from "../../axios"
import {AppDispatch} from "../index"
import {blogSlice} from "../slices/blogSlice"

export const fetchBlogs = (page = 1, count = 50) => {
    return async (dispatch: AppDispatch) => {
        try {
            dispatch(blogSlice.actions.fetching())
            const response = await axios.get("todos", {params: { page, count }})

            dispatch(blogSlice.actions.fetchSuccess({blogs: response.data.products}))
        } catch (e) {
            dispatch(blogSlice.actions.fetchError(e as Error))
            console.log(e)
        }
    }
}
